//설치 파일: 
//npm install prop-types
//npm install axios
//npm install react-router-dom

//시작 메뉴
//npm start

//https://yts.mx/api/v2/list_movies.json
//https://yts-proxy.now.sh/list_movies.json

function App() {

  return (
    <HashRouter>
      <Route path="/home">
        <h1>Home</h1>
      </Route>
      <Route path="/home/introduction">
        <h1>Introduction</h1>
      </Route>
      <Route path="/about">
        <h1>About</h1>
      </Route>

    </HashRouter>
  );
}

export default App;
